import './App.css';
import Axios from 'axios';
import { useState } from "react";

function App() {
  const [queryResult, setQueryResult] = useState([]); 
  const [queryList, setQueryList] = useState([]);

  const getEmployees = () => {
    console.log("clicked");
    Axios.get("http://localhost:3001/employees").then((response) => {
      const newQuery = response.data;
      setQueryResult(newQuery);
      updateResult();
    }) 
  } 

  const updateResult = () => {  
    setQueryList(queryResult.map((val, key) => {
      <div> {
        Object.keys(val).map((keyName, index) => {
          return <div>
              <p>
                {console.log(keyName + ": " + val[keyName])}
                {keyName}: {val[keyName]}
              </p>
            </div>
        })
      }
      </div>
    }))
  }

  return (
    <div className="App">  
      <h1>Hello world</h1>
      <button onClick={getEmployees}>Get Employee</button>
      <button onClick={updateResult}>Show Employees</button>
      {queryList}
    </div>
  );
}

export default App;
